package leetcode;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

/*p,q,p中包含q的子串(q的顺序不重要)*/
public class L438_FindSubStr {
    public static List<Integer> findAnagrams(String s, String p) {
        if(s.length()<p.length()){
            return new ArrayList<>();
        }
        List<Integer> res=new ArrayList<>();
        Map<Character,Integer> map=new HashMap();
        for(int i=0;i<p.length();i++){
            char c=p.charAt(i);
            if(map.containsKey(c)){
                map.put(c,map.get(c)+1);
            }else{
                map.put(c,1);
            }
        }
        Map<Character,Integer> temp=new HashMap();
        for(int i=0;i<s.length()-p.length()+1;i++){
            if(temp.isEmpty()){
                for(int k=i;k<i+p.length();k++){
                    char c=s.charAt(k);
                    if(temp.containsKey(c)){
                        temp.put(c,temp.get(c)+1);
                    }else{
                        temp.put(c,1);
                    }
                }
            }else{
                if(temp.containsKey(s.charAt(i-1))){
                    int count=temp.get(s.charAt(i-1));
                    if((count-1)==0){
                        temp.remove(s.charAt(i-1));
                    }else{
                        temp.put(s.charAt(i-1),count-1);
                    }
                }
                if(temp.containsKey(s.charAt(i+p.length()-1))){
                    int count=temp.get(s.charAt(i+p.length()-1));
                    temp.put(s.charAt(i+p.length()-1),count+1);
                }else{
                    temp.put(s.charAt(i+p.length()-1),1);
                }
            }
            boolean flag=true;
            for(Map.Entry e:temp.entrySet()){
                boolean bl=map.containsKey(e.getKey());
                char in=(char)e.getKey();
                int val=(int)e.getValue();
                if(map.containsKey(e.getKey())&&(int)map.get(e.getKey())==(int)e.getValue()){

                }else{
                    flag=false;
                    break;
                }
            }
            if(flag){
                res.add(i);
            }

        }
        return res;
    }

    public static void main(String[]args){
        String s="";
        String p="";
        findAnagrams(s,p);
    }
}
